import { useQuery, gql } from '@apollo/client';
import { Routes, Route, Link } from "react-router-dom";
import Header from "./components/Header";
import Category from "./components/Category";
import Cart from "./components/Cart";
import CategoryAll from "./pages/CategoryAll";
import CategoryClothes from "./pages/CategoryClothes";
import CategoryTech from "./pages/CategoryTech";

export default function App() {
  return (
      <div>
        <h2>My first Apollo app ðŸš€</h2>
        {/*<Header />*/}
          {/*<Category />*/}
          <Routes>
              <Route path="/" element={<CategoryAll />} />
              <Route path="clothes" element={<CategoryClothes />} />
              <Route path="tech" element={<CategoryTech />} />
          </Routes>
        {/*  <Tracks />*/}
      </div>
  );
}

function Home() {
    return (
        <>
            <main>
                <h2>Welcome to the homepage!</h2>
                <p>You can do this, I believe in you.</p>
            </main>
            <nav>
                <Link to="/about">About</Link>
            </nav>
        </>
    );
}

function About() {
    return (
        <>
            <main>
                <h2>Who are we?</h2>
                <p>
                    That feels like an existential question, don't you
                    think?
                </p>
            </main>
            <nav>
                <Link to="/">Home</Link>
            </nav>
        </>
    );
}
